INSERT INTO `ss_contimg_data` VALUES (1,'<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp; 首实教育公司将领域教学、特色教育、选择性活动三者有机融合，以《规程》《纲要》为指导，以&ldquo;五大领域&rdquo;教育系列教材为核心，以多媒体教学为主要手段，促进幼儿全面发展的课程<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; 凸显园本化的特色课程：注重幼儿关键期的培养，强调适当、适度的超前，培养听说、沟通交流能力的，突出特色教育。</span>',0,0,'',0),(2,'<span style=\"font-size:16px;\">&nbsp; &nbsp; &nbsp; 金色未来培训学校成立于2010年9月，秉承&ldquo;办最好的教育，让每名孩子拥有美好童年&rdquo;的办学理念，让孩子在&ldquo;玩中学&rdquo;，爱上课程，爱上学习。现有古城、老山、苹果园三个校区，目前共开设数学、英语、机器人、书法等课程，共计22大类，451个教学班，学员7000余人次。</span>\r\n<div><span style=\"font-size:16px;\">&nbsp; &nbsp; &nbsp; &nbsp;重视教师队伍的师德建设和专业成长，不断引进高层次人才充实教师队伍，拥有优秀管理团队、骨干教师团队、特色教师团队（才艺和外籍教师等）。在园幼儿曾应邀参加2008年奥运会闭幕式演出；中南海、人民大会堂等重要接待演出；冰岛、欧洲、日本等国家演出及各类重要节目演出。每年约有52%的在园幼儿通过英语、器乐、舞蹈、美术等科目考级，约有38%的幼儿获得国家级、市级、区级等各种器乐、舞蹈、绘画等比赛奖项，每年幼儿参加演出电视节目录制近1500人次。</span></div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n',0,0,'',0),(3,'<span style=\"font-size:24px;\"><span style=\"font-family:宋体;\">丰富多元的选择性课程：按照&ldquo;关注每名幼儿，探索各种优势&rdquo;的理念，以发现优势、培养优势为导向，以幼儿园师资、文化优势为保障，以幼儿园和幼儿双向选择为导向，旨在发现与尊重个体的特殊价值、促进幼儿个性化发展。</span></span>',0,0,'',0);
/*!40000 ALTER TABLE `ss_contimg_data` ENABLE KEYS */;
UNLOCK TABLES;

