INSERT INTO `ss_expand` VALUES (7,40,0,'全面发展的领域课程','','','','全面发展的领域课程：以《规程》《纲要》为指导，以“五大领域”教育系列教材为核心，以多媒体教学为主要手段，促进幼儿全面发展的课程。','http://shoushi-edu.oyaoyin.com/index.php?m=content&c=index&a=show&catid=40&id=7',0,99,1,'shoushi',1499842682,1502519335),(2,12,0,'毕业典礼','','','','国学是儿时充分了解中国传统文化的时期，一起学习国学文化吧！','http://shoushi-edu.oyaoyin.com/index.php?m=content&c=index&a=show&catid=12&id=2',1,99,1,'shoushi',1499609924,1500863597),(4,25,0,'北京市工艺美术高级学校','','','','2017年，北京首实教育科技有限公司现与北京市工艺美术高级学校本着“互惠互利、优势互补、共同发展的原则”达成合作协议，在人才培养、实习基地建设、招聘与就业、在职教师培训、专家指导咨询、课程研发等方面开展合作。','http://shoushi-edu.oyaoyin.com/index.php?m=content&c=index&a=show&catid=25&id=4',0,99,1,'shoushi',1499825145,1500866371),(5,26,0,'董事长寄语','','','','1953年，首钢幼教“敢为天下先”创办了第一个幼儿园，至此以后，经过60余年的风雨洗礼，不断发展壮大。2016年成立北京首实教育科技有限公司，成为首钢幼儿教育的新载体，首实教育公司将继续秉承“关注每名幼儿，探索各种优势”的理念，给孩子们提供一个充满乐趣、安全、健康的教育环境，培养孩子们热爱生命、诚实守信的良好品格、使孩子们在身体、心理、智力、社交等方面获得全面均衡的发展。','http://shoushi-edu.oyaoyin.com/index.php?m=content&c=index&a=show&catid=26&id=5',0,99,1,'shoushi',1499826932,1500866596),(9,20,0,'北京首实教育有限公司','','','','北京首实教育科技有限公司，依托于北京首钢幼教60多年的教学经验，自1953年成立第一家幼儿园，目前园所遍布北京、上海、河北、山西、贵州等地，为中国中关村高科技企业，下设首钢幼儿保教中心、金色未来培训学校两个实体，业务涵盖幼儿教育和特色培训，是一所致力于为孩子提供多元化的教育资源和美好的学习体验的教育科技集团。','http://shoushi-edu.oyaoyin.com/index.php?m=content&c=index&a=show&catid=20&id=9',0,99,1,'shoushi',1499927588,1502781324),(12,12,0,'艾唯德体育','','','','国学是儿时充分了解中国传统文化的时期，一起学习国学文化吧！','http://shoushi-edu.oyaoyin.com/index.php?m=content&c=index&a=show&catid=12&id=12',0,99,1,'shoushi',1500102336,1500863540),(18,12,0,'曲棍球','','','','国学是儿时充分了解中国传统文化的时期，一起学习国学文化吧！','http://shoushi-edu.oyaoyin.com/index.php?m=content&c=index&a=show&catid=12&id=18',0,99,1,'shoushi',1500863603,1500863618),(14,25,0,'启迪教育投资（北京）有限公司','','','','2017年，北京首实教育科技有限公司与启迪教育投资（北京）有限公司达成合作协议，首实教育旗下幼儿园和培训学校作为启迪幼教人才培养计划的实践实训基地，双方合作举办学前教育专业，成立启迪首实幼教班，首实教育旗下幼儿园的优质教育内容作为必修或选修课程或教材引入启迪幼教人才培养项目，并适时开展对幼儿园教师进行师资培训等活动。','http://shoushi-edu.oyaoyin.com/index.php?m=content&c=index&a=show&catid=25&id=14',0,99,1,'shoushi',1500262061,1502416330),(19,12,0,'圣诞节','','','','国学是儿时充分了解中国传统文化的时期，一起学习国学文化吧！','http://shoushi-edu.oyaoyin.com/index.php?m=content&c=index&a=show&catid=12&id=19',0,99,1,'shoushi',1500863626,1500863640),(20,12,0,'童话剧','','','','国学是儿时充分了解中国传统文化的时期，一起学习国学文化吧！','http://shoushi-edu.oyaoyin.com/index.php?m=content&c=index&a=show&catid=12&id=20',0,99,1,'shoushi',1500863644,1500863660);
