INSERT INTO `ss_teacher` VALUES (2,32,0,'冯婉桢','','http://shoushi-edu.oyaoyin.com/uploadfile/2017/0709/20170709102543399.jpg','','2010年毕业于北京师范大学，并取得博士学位，后留校任教至今，现任中国教育学会教育学分会美育专业委员会委员、北京师范大学学前教育研究所教师，主要研究方向为幼儿教师专业发展、学前儿童美术教育、学前教育政策。曾主持教育部社会科学青年基金项目“经济发展中的我国学前教育资源配置效率研究”、北京师范大学教学改革与建设项目“构建自主探究式实验教学模块，提升师范生面向儿童开展美术教育的能力”等多项课题。','http://shoushi-edu.oyaoyin.com/index.php?m=content&c=index&a=show&catid=32&id=2',0,99,1,'shoushi',1499761667,1499761690),(3,32,0,'姜维静','','http://shoushi-edu.oyaoyin.com/uploadfile/2017/0724/20170724105221554.png','','原中国学前教育研究会兼北京市学前教育研究会副秘书长、原《学前教育》 编辑部主编，中国老教授协会儿童早期教育专业委员会研究员，中国学前教育研究会中国教师发展研究中心特聘专家。姜维静老师从事幼教工作40多年来，长期潜心于学前教育的研究与实践。','http://shoushi-edu.oyaoyin.com/index.php?m=content&c=index&a=show&catid=32&id=3',0,99,1,'shoushi',1500261453,1500864747),(4,32,0,'李国荣','','http://shoushi-edu.oyaoyin.com/uploadfile/2017/0724/20170724105956493.png','','原石景山教委学前科科长，现任职于北京市教委学前处。从事学前教育实践和研究工作35年，在教育管理、教师专业发展、教育科研等方面积累了丰富的经验。她主持的北京市“十二五”课题民间体育游戏研究，取得了丰硕的成果，《幼儿园民间体育游戏的时间与创新》一书已正式出版发行。','http://shoushi-edu.oyaoyin.com/index.php?m=content&c=index&a=show&catid=32&id=4',0,99,1,'shoushi',1500864954,1502782055);
/*!40000 ALTER TABLE `ss_teacher` ENABLE KEYS */;
UNLOCK TABLES;

