INSERT INTO `ss_teachers` VALUES (1,33,0,'富有爱心，用爱呵护每一个幼儿','','http://shoushi-edu.oyaoyin.com/uploadfile/2017/0711/20170711041743586.jpg','','爱是最好的教育，带着一颗爱心去工作。',0,'http://shoushi-edu.oyaoyin.com/index.php?m=content&c=index&a=show&catid=33&id=1',0,99,1,'shoushi',1499761871,1499761890),(3,29,0,'首钢幼儿保教中心','','http://shoushi-edu.oyaoyin.com/uploadfile/2017/0714/20170714102309667.jpg','','首钢幼儿保教中心，以“携手合作，发展共赢”为共同目标，形成涵盖精品高端园、品牌特色园、普惠优质园、区域领先园的多元化幼教办园模式。\r\n',0,'http://shoushi-edu.oyaoyin.com/index.php?m=content&c=index&a=show&catid=29&id=3',0,99,1,'shoushi',1499998785,1499998992),(4,29,0,'博乐国际幼儿园','','http://shoushi-edu.oyaoyin.com/uploadfile/2017/0714/20170714102309667.jpg','','博乐国际幼儿园，以“让孩子遇见一个卓越的自己、为孩子搭建一个美丽的未来”为办学目标，打造高品位、国际化幼儿园。---定位为高端园',0,'http://shoushi-edu.oyaoyin.com/index.php?m=content&c=index&a=show&catid=29&id=4',0,99,1,'shoushi',1500000302,1500000319),(5,48,0,'1','','http://shoushi-edu.oyaoyin.com/uploadfile/2017/0804/20170804023447376.jpg','','',0,'http://shoushi-edu.oyaoyin.com/index.php?m=content&c=index&a=show&catid=48&id=5',0,99,1,'shoushi',1500089269,1501828489),(6,48,0,'2','','http://shoushi-edu.oyaoyin.com/uploadfile/2017/0804/20170804104312599.jpg','','',0,'http://shoushi-edu.oyaoyin.com/index.php?m=content&c=index&a=show&catid=48&id=6',0,99,1,'shoushi',1500102857,1501814599),(20,48,0,'3','','http://shoushi-edu.oyaoyin.com/uploadfile/2017/0804/20170804023019744.jpg','','',0,'http://shoushi-edu.oyaoyin.com/index.php?m=content&c=index&a=show&catid=48&id=20',0,99,1,'shoushi',1501814547,1501828473),(8,33,0,'严格的任职标准','','http://shoushi-edu.oyaoyin.com/uploadfile/2017/0711/20170711041743586.jpg','','均来自早期教育及相关专业，经过系统的专业能力测试。',0,'http://shoushi-edu.oyaoyin.com/index.php?m=content&c=index&a=show&catid=33&id=8',0,99,1,'shoushi',1500261855,1500865348),(19,33,0,'不断提升专业素质','','http://shoushi-edu.oyaoyin.com/uploadfile/2017/0711/20170711041743586.jpg','','开展大量的专业培训，不断提高教师队伍。',0,'http://shoushi-edu.oyaoyin.com/index.php?m=content&c=index&a=show&catid=33&id=19',0